import React from 'react';

const Input = (props) => {
    return(
        <input
            className={`${props.className}`}
            type={`${props.type} || 'pa'`}
            value={props.value}
            placeholder={props.placeholder}
            id={props.id}
            name={props.name}
        />
    );
};

export default Input;
